import React from "react";

function About() {
    return (
        <div>
            <h2 className="about-me">
                About me
            </h2>
            <div className="about-page">
                <p >I'm a Front-end/Fullstack. </p>
                <p>This project is an image search engine that I have set up by the Library of Congress API.
                    Feel free to search for any images you wish!</p>

            </div>
        </div>
    );
};

export default About;
